// hooks and interceptors per client, for fast access.
type (
	hooks struct {
		Agent, Conversation, DocumentChunk, KnowledgeBase, Tool, User, Workflow,
		WorkflowExecution []ent.Hook
	}
	inters struct {
		Agent, Conversation, DocumentChunk, KnowledgeBase, Tool, User, Workflow,
		WorkflowExecution []ent.Interceptor
	}
)
